import React from 'react';
import MathJax from 'react-mathjax';

const GameOver = ({ score, time, penalty, initialBushes, difficultyMultiplier }) => {
  const penaltyMultiplier = 1;
  const timeMultiplier = 0.1;
  const overallScore = Math.floor(
    (score - ((penalty - initialBushes) * penaltyMultiplier) - (time * timeMultiplier)) *
      difficultyMultiplier
  );

  // Define the TeX formatted equation
  const texFormula = `\\text{Overall Score: } \\lfloor (\\text{score} - (\\text{penalty} - \\text{initialBushes}) \\cdot \\text{penaltyMultiplier} - \\text{time} \\cdot \\text{timeMultiplier}) \\cdot \\text{difficultyMultiplier} \\rfloor`;
  return (
    <div className="game-over">
      <h1>Game Over</h1>
      <h2>Overall Score: {overallScore}</h2>
      <h6>
        Overall Score Formula:
      <MathJax.Provider>
        <MathJax.Node formula={texFormula} />
      </MathJax.Provider>
      </h6>
      <p>Score: {score}</p>
      <p>Time: {time} seconds</p>
      <p>Penalties: {penalty}</p>
      <p>InitialBushes: {initialBushes}</p>
    </div>
  );
};

export default GameOver;
